float sat_lookup(double iz, float satLUT[]){
    long int idx;

    if (iz >= (444000)*IZ_STEP) {
        // printf("Maximum iz (4440 Ampere) reached! Are you sure that you want to burn the motor down?\n");
        // getch();
        // system("pause");

        // 末端线性延长。
        idx = (long int)(444000);
        return (iz - idx*IZ_STEP) * IZ_STEP_INV * (satLUT[idx+1]-satLUT[idx]) + satLUT[idx]; // 一阶插值？
    }

    // return satLUT[(int)(iz/IZ_STEP+0.5)]; // This yields bad results with obvious oscillation (voltages and currents)

    idx = (long int)(iz*IZ_STEP_INV);
    return (iz - idx*IZ_STEP) * IZ_STEP_INV * (satLUT[idx+1]-satLUT[idx]) + satLUT[idx]; // 一阶插值？
}


